import React, { Component } from "react";
import { withRouter} from "react-router-dom";
import Container from "react-bootstrap/Container";
import Navigate from "./Navigate";
import Billboard from "./Billboard";

export class Home extends Component {

  constructor(props){
    super(props);
    this.state = {
      songList:[],
      error:"no",
      email:null
    };
  }
  
  componentWillMount() {
       if(this.props === undefined || this.props === null){
         this.props.history.push('/unauthorized');
       }
       else{
         if(this.props.email === undefined || this.props.email === null){
          this.props.history.push('/unauthorized');
         }
        this.setState({email:this.props.email},console.log("Get email from app component "+this.props.email));
        fetch('http://localhost:5080/billboard100', { 
            method: 'POST', 
            headers: { 
              "Access-Control-Allow-Origin": "http://localhost:3000",
              "Access-Control-Allow-Methods": "POST",
              "Access-Control-Allow-Headers": "Authorization",
              "Content-Type": "application/json" 
            }
        }) 
        .then(
          (response)=>{ return response.json() }
        )
        .catch(error=>{this.setState({error:error})})
        .then(data=>this.setState({songList:data}))
        .then(()=>this.state.songList.forEach(e => {
          console.log(e)
        }))
       }
  }

  componentDidMount() {
    this.state.songList.forEach(e => {
      console.log(e)});
  }
  

  render() {
    
        return (
          <Container fluid>
          <Navigate/>
          <Container fluid="lg">
            <Container fluid="lg">
            
            </Container>
          </Container>
          </Container>
        );
  }

}

export default withRouter(Home);
